  false,\n\t\"url\": null,\n\t\"notes\": \"NeighborSpace is a nonprofit organization
  whose mission is to acquire and support the community based management of small
  parks, gardens, natural areas, river edges, and scenic landscapes in the City of
  Chicago for preservation, conservation, and educational public open space purposes.rnrnNeighborSpace
  primarily focuses on those parcels where community groups have established gardens
  or parks. These groups apply to NeighborSpace so the site can be owned by a nonprofit
  that has a mission to preserve and protect the sites. NeighborSpace continues to
  work in partnership with the three founding governmental agencies the City of Chicago,
  Chicago Park District, the Forest Preserve District of Cook County, as well as other
  nonprofit organizations and local community groups. To view or use these shapefiles,
  compression software and special GIS software, such as ESRI ArcGIS, is required.
  To download, right-click the \"Download\" link above and choose \"Save link as.\"\",\n\t\"license_title\":
